DELIMITER $$
CREATE TRIGGER `Escuteiros_Correct_Foto` BEFORE INSERT ON `escuteiros` FOR EACH ROW if new.Foto = '' then 
	set new.Foto = (select Foto from 			escuteiros where IDEscuteiro = 0);
end if
$$
