--
DELIMITER $$
CREATE TRIGGER `Change_Saldo_Insert` AFTER INSERT ON `movimentos` FOR EACH ROW if new.TipoMovimento = "Entrada de tesouraria" then 
	update caixas set Saldo = Saldo + new.Valor where IDCaixa = new.IDCaixa;
else 
	if new.TipoMovimento = "Saída de tesouraria" THEN
		update caixas set Saldo = Saldo -new.Valor where IDCaixa = new.IDCaixa;
	end if;
end if
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `Change_Saldo_Update` AFTER UPDATE ON `movimentos` FOR EACH ROW if new.TipoMovimento = "Entrada de tesouraria" and new.Valor <> old.Valor then
	update caixas set Saldo = Saldo - old.Valor where IDCaixa = new.IDCaixa;
	update caixas set Saldo = Saldo + new.Valor where IDCaixa = new.IDCaixa;
else if new.TipoMovimento = "Saída de tesouraria" and new.Valor <> old.Valor then 
	update caixas set Saldo = Saldo + old.Valor where IDCaixa = new.IDCaixa;
	update caixas set Saldo = Saldo - new.Valor where IDCaixa = new.IDCaixa;
	end if;
end if
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `Delete_Mov` AFTER DELETE ON `movimentos` FOR EACH ROW if old.TipoMovimento = "Entrada de tesouraria" then 
	update caixas set Saldo = Saldo - old.Valor where IDCaixa = old.IDCaixa;
else 
	if old.TipoMovimento = "Saída de tesouraria" THEN
		update caixas set Saldo = Saldo + old.Valor where IDCaixa = old.IDCaixa;
	end if;
end if
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `Stop_Insert_On_Closed_Atividade` BEFORE INSERT ON `movimentos` FOR EACH ROW if ((select Ativa from atividades where IDAtividade = new.Atividade) = 0) then
	signal sqlstate '45000' set MESSAGE_TEXT = "A atividade está encerrada, impossibilitando a criação de novos movimentos";
    end if
$$
DELIMITER ;

